webpackJsonp([0xc6506e02bba7],{8931:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"All Wound Up",date:"29 Dec 2002",slug:"/2002-12-29-all-wound-up/",tags:"Y2002"},html:"<p>There's nothing like a 3-year-old with a birthday the same week as Christmas to keep things lively around the house between the holidays. And next year I'm sure that we will <em>not</em> invite the relatives to Christmas dinner and again two days later for birthday coffee and cake. It's like a bad case of d&eacute;j&agrave; vu.</p>\n<p>And on a completely unrelated note, I hate editing style sheets as well. After unsuccessfully trying to adapt the BlueRobot style from b2, I gave up and dug out my old MT style sheet from September.</p>"},next:{fields:{title:"Oy Vey, All Ye Faithful",date:"26 Dec 2002",slug:"/2002-12-26-oy-vey-all-ye-faithful/"}},previous:{fields:{title:"I'll kill that cat!",date:"31 Dec 2002",slug:"/2002-12-31-ill-kill-that-cat/"}}},{node:{fields:{title:"Oy Vey, All Ye Faithful",date:"26 Dec 2002",slug:"/2002-12-26-oy-vey-all-ye-faithful/",tags:"Y2002"},html:'<p><a href="http://www.whss.org/for_immediate_release_clear_chan.htm">Clear Channel Entertainment Purchases Christmas and Hunukkah - Will Merge the Holidays.</a> Does this include the German Second Christmas Day, or Boxing Day  as it\'s called in the Anglo-Saxon world?</p>'},next:{fields:{title:"Holiday Greetings",date:"26 Dec 2002",slug:"/2002-12-26-holiday-greetings/"}},previous:{fields:{title:"All Wound Up",date:"29 Dec 2002",slug:"/2002-12-29-all-wound-up/"}}},{node:{fields:{title:"Holiday Greetings",date:"26 Dec 2002",slug:"/2002-12-26-holiday-greetings/",tags:"Y2002"},html:'<p><img alt="crhbdaym1.jpg" src="http://www.papascott.de/wordpress/wp-content/uploads/2002/12/crhbdaym1.jpg" width="325" height="253" border="0" /></p>\n<p>Chiristopher would like to remind everyone that, while Christmas is a grand holiday, the <em>real</em> festivities <a href="/1999/12/26">begin</a> <a href="/1999/12/27">tomorrow</a>.</p>'},next:{fields:{title:"Frozen In",date:"25 Dec 2002",slug:"/2002-12-25-frozen-in/"}},previous:{fields:{title:"Oy Vey, All Ye Faithful",date:"26 Dec 2002",slug:"/2002-12-26-oy-vey-all-ye-faithful/"}}}],pathPrefix:"",first:!1,last:!1,index:801,pageCount:1101}}}});
